// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract FundingPlatform {
    struct Campaign {
        address creator;
        string cause;
        string futurePlans;
        uint startDate;
        uint endDate;
        uint fundingDate;
        uint goalAmount;
        uint currentAmount;
        bool isActive;
    }
    mapping(uint => mapping(address => uint)) public funders; 

    Campaign[] public campaigns;

    event CampaignCreated(uint indexed campaignId, address indexed creator);
    event FundedBy(uint indexed campaignId, address indexed funder, uint amount); // New event to track funders

    modifier onlyCampaignCreator(uint _campaignId) {
        require(msg.sender == campaigns[_campaignId].creator, "Only the campaign creator can perform this action");
        _;
    }

    modifier onlyActiveCampaign(uint _campaignId) {
        require(campaigns[_campaignId].isActive, "Campaign is not active");
        _;
    }

    function createCampaign(
        string memory _cause,
        string memory _futurePlans,
        uint _startDate,
        uint _endDate,
        uint _fundingDate,
        uint _goalAmount
    ) public {
        require(_fundingDate <= _endDate, "Funding date cannot be later than end date");
        
        Campaign memory newCampaign = Campaign({
            creator: msg.sender,
            cause: _cause,
            futurePlans: _futurePlans,
            startDate: _startDate,
            endDate: _endDate,
            fundingDate: _fundingDate,
            goalAmount: _goalAmount,
            currentAmount: 0,
            isActive: true
        });

        campaigns.push(newCampaign);
        emit CampaignCreated(campaigns.length - 1, msg.sender);

        if (block.timestamp > _endDate) {
            campaigns[campaigns.length - 1].isActive = false;
        }
        //campaigns[campaigns.length - 1].funders = new mapping(address => uint);
    }

    function fundCampaign(uint _campaignId) public payable onlyActiveCampaign(_campaignId) {
        require(msg.value > 0, "Funding amount must be greater than 0");
        require(msg.sender != campaigns[_campaignId].creator, "Campaign creator cannot fund their own campaign");

        funders[_campaignId][msg.sender] += msg.value; // Updated to allow multiple funders
        campaigns[_campaignId].currentAmount += msg.value;
        
        emit FundedBy(_campaignId, msg.sender, msg.value);
    }

    function getCampaignDetails(uint _campaignId) public view returns (
        address creator,
        string memory cause,
        string memory futurePlans,
        uint startDate,
        uint endDate,
        uint fundingDate,
        uint goalAmount,
        uint currentAmount,
        bool isActive
    ) {
        Campaign memory campaign = campaigns[_campaignId];
        return (
            campaign.creator,
            campaign.cause,
            campaign.futurePlans,
            campaign.startDate,
            campaign.endDate,
            campaign.fundingDate,
            campaign.goalAmount,
            campaign.currentAmount,
            campaign.isActive
        );
    }

    function getActiveCampaignCount() public view returns (uint) {
        uint count = 0;
        for (uint i = 0; i < campaigns.length; i++) {
            if (campaigns[i].isActive) {
                count++;
            }
        }
        return count;
    }
}

